import React from 'react';
import Home from './Components/Home/Home';
import './App.css';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



function App() {

  return (
    <Router>
      <Switch>
        <Route path='/'>
          <div className="App">
            <Home />
          </div >
        </Route>
      </Switch>

    </Router>
  )
}

export default App;
